description:
The Complete Official &amp; Leaked Lana Del Rey Collection

***Please note

1. I'm aware some of the demos &amp; instrumentals are fan made. I included them because I like them &amp; thought others might too.

2. Remix EPs &amp; Singles are the prominent remix releases &amp; official EPs. The Remixes albums are official remixes that weren't featured in any EPs

3. What some may have labeled 'demo 1' may be what I have labeled as 'demo 2' please do not tell me it's wrong. 

4. There are over 600 songs in this torrent, I've included links to screencaps of each album instead of typing it all out.

5.At the end of 2014, &amp; the years following, I will make another torrent that has all of the releases &amp; leaks from that year. Please do not post '*title of song* leaked' 'where's *insert title of new song* For the mean time, you can keep up with the latest leaks and releases on my MEGA post&amp; keep updated on the latest Lana new at lanaboards.com and pophatesfag.org (The #1 source for all things pop)

6. Videos will be included in a separate torrent 

Please keep this torrent alive! Seed as long as you can &amp; enjoy the music :)

Bitrate: 128-320 kbps

